import React from 'react';
import ReactDOM from 'react-dom/client';

import Nav from "./components/Nav"
import Main from "./components/Main"

function App () {
    return (
        <div>
            <Nav />
            <Main />
        </div>
    );
}

ReactDOM.render (<App />, document.getElementById("root"));
